  <?php
        if(isset($_POST['save'])){
            $EditForm = isset($_POST['id']);
            unset($_POST['save']);

            if(isset($_FILES['image']) && $_FILES['image']['error'] === UPLOAD_ERR_OK ) {
                $blob = base64_encode( file_get_contents( $_FILES['image']['tmp_name'] ) );
                $_POST['image'] = $blob;
            }
            else{
                if($EditForm){
                    $_POST['image'] = ReadSpecificVehicle($_POST['id'])[0]->image;
                }
                else{
                    if($_POST['vehicleType']=="car"){
                        $_POST['image'] = "";
                    }
                    else{
                        $_POST['image'] = "";
                    }
                }
            }
            
            $isSave = $EditForm ? EditVehicle($_POST) : CreateVehicle($_POST);

            if($isSave){
                if(!$EditForm){
                    pageRefresh("vehicle");
                }
                else{
                    pageRefresh("vehicle-create-update/?id=".$_POST['id']);
                }
                  
            }
        }
    ?>

